import React from 'react';
import './Project.css';

const project = (props) => {
    <div className="Project">
        <div className="ProjectImg">
            <img src={props.image}/>
        </div>
        <div className="ProjectText">
            <h3>{props.title}</h3>
            <h4>{props.date}</h4>
            <p>{props.description}</p>
        </div>
    </div>
}

export default project;
